import React from 'react';
import { View , Text , TextInput ,StyleSheet } from 'react-native';
import DropDownPicker from 'react-native-dropdown-picker';


const MainHome = () => {
    return (
        <View>
            <View>
                <TextInput style={styles.input} placeholder="Enter name" />
            </View>
            <View>
                <TextInput style={styles.input} placeholder="Enter father name" />
            </View>
            <View>
                <TextInput style={styles.input} placeholder="Enter cnic number" />
            </View>
            <View>
                <TextInput style={styles.input} placeholder="Enter Date of Birth" />
            </View>
            <View>
                <TextInput style={styles.input} placeholder="Enter family members" />
            </View>
            <View style={styles.container}>
      <Text style={styles.paragraph}>
        React native dropdown picker
      </Text>
      <DropDownPicker
          items={[
              {label: 'English', value: 'en'},
              {label: 'Deutsch', value: 'de'},
              {label: 'French', value: 'fr'},
          ]}
          defaultIndex={0}
          containerStyle={{height: 40}}
          onChangeItem={item => console.log(item.label, item.value)}
      />
    </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        paddingTop: Constants.statusBarHeight,
        backgroundColor: '#ecf0f1',
        padding: 8,
      },
      paragraph: {
        margin: 24,
        fontSize: 18,
        fontWeight: 'bold',
        textAlign: 'center',
      },
    input: {
        height: 40,
        margin: 12,
        borderWidth: 1,
        borderColor : 'rgb(195, 195, 195)',
        padding: 10,
        borderRadius : '5px',

      //   backgroundColor : '#ffffff'
      },
})

export default MainHome;
